export const signupActionTypes = Object.freeze({
  SIGNUP_STOP_FETCHING: 'signup/stopFetching',
  SIGNUP_SET_FETCHING_ERROR: 'signup/setFetchingError',

  SIGNUP_SET_STATUS: 'signup/setStatus',
  SIGNUP_FILL: 'signup/fill',

  SIGNUP_FETCH_ASYNC: 'signup/fetchAsync',
});
